import React, {Component} from 'react'
import Table from './Table'


class App extends Component {
    render() {
      return (
        <div className="container">
        <form>
            <label>
                Name:
                <input type="text" name="name" />
            </label>
            <input type="submit" value="Submit" />
        </form>
        <Table />

        </div>
      )
    }
  }
export default App
